import React from 'react'
import { Navigate, useNavigate } from 'react-router-dom';

const ProtectedRoute = ({children}) => {

    const navigate = useNavigate


    let auth = 'true';
    if (!auth){
        <Navigate to='/login'></Navigate>
    }








  return (
    <div></div>
  )
}

export default ProtectedRoute
